import CCTC_API_SRVC:HANDLERS:*;
import CCTC_API_SRVC:Util:*;

class CCTC_Transcript extends CCTC_API_SRVC:HANDLERS:CCTCRequestHandler
   method CCTC_Transcript();
   method getResult(&bindVars As array of any) Returns string;

end-class;

method CCTC_Transcript
   %Super = %This;
end-method;

method getResult
   /+ &bindVars as Array of Any +/
   /+ Returns String +/
   /+ Extends/implements CCTC_API_SRVC:HANDLERS:CCTCRequestHandler.getResult +/
   Local string &op = &bindVars.Shift();

   Local string &result = "";
   Local string &delimit = ">";
   Local CCTC_API_SRVC:Util:queryRequest &query_request, &query_request0;
   Local array of string &resultList, &resultList0;
   Local string &sisCrseId;
   Local string &sisTermId;
   Local number &j;

   Evaluate &op
   When "degree"
      &query_request = create CCTC_API_SRVC:Util:queryRequest("CCTC_ACAD_DEGREE", &bindVars);
      &result = &query_request.getResult();
      Break;
   When "summary"
      &query_request = create CCTC_API_SRVC:Util:queryRequest("CCTC_TRNS_SUMMARY", &bindVars);
      &result = &query_request.getResult();
      Break;
   When "school"
      &query_request = create CCTC_API_SRVC:Util:queryRequest("CCTC_INSTITUTION_DETAIL", &bindVars);
      &result = &query_request.getResult();
      Break;
   When "session"
      &query_request = create CCTC_API_SRVC:Util:queryRequest("CCTC_TRNS_SESSION", &bindVars);
      &resultList = &query_request.getResultList();

      /* term courses */
      &j = 1;
      While (&j <= &resultList.Len)
         &bindVars [2] = &resultList [&j];
         &query_request0 = create CCTC_API_SRVC:Util:queryRequest("CCTC_STDNT_ENRL", &bindVars);
         &resultList0 = &query_request0.getResultList();
         Local string &term_crse = &resultList0.Join(&delimit, "", "");

         &resultList.Replace(&j, 1, &resultList [&j], &term_crse);
         &j = &j + 11;
      End-While;

      &result = &query_request.getResultFromList(&resultList);

      Break;
   End-Evaluate;

   Return &result;
end-method;
